import HOMEPRODUCTBANNER from '../../assets/Home-Product-Banner.png'
const ShopOurProductHome =() =>{
    return(
        <div className='product-home'>
            <h1>
                Shop Our Products!
            </h1>
            <img src={HOMEPRODUCTBANNER}/>
            <button>Shop</button>
        </div>
    );
}

export default ShopOurProductHome
